settings.style:
:root {
  --max-table-width: 600px;
  --max-column-width: 310px;
}

.mcbt_name {
  font-size: 0.8125rem;
  padding-top: 10px;
  text-align: center;
}

.mcbt_regular_price {
  font-size: 0.8125rem;
  padding-top: 10px;
  text-align: center;
}

.mcbt_sale_price {
  font-size: 0.8125rem;
  padding-top: 10px;
  text-align: center;
}

.mcbt_on_sale {
  text-decoration: line-through;
}

.mcbt_image_link {
  width: 100%;
  max-width: var(--max-column-width);
  height: auto;
}

table {
  border-spacing: 0;
  font-family: sans-serif;
  color: #333333;
}
td {
  padding: 0;
}
img {
  border: 0;
}
div[style*="margin: 16px 0"] { 
  margin:0 !important;
}
.wrapper {
  width: 100%;
  table-layout: fixed;
  -webkit-text-size-adjust: 100%;
  -ms-text-size-adjust: 100%;
  background-color: #ffffff;
}
.webkit {
  max-width: var(--max-table-width);
  margin: 0 auto;
}
.outer {
  margin: 0 auto;
  width: 100%;
  max-width: var(--max-table-width);
}
.multi-column {
  text-align: center;
  font-size: 0;
  padding-top: 10px;
  padding-bottom: 10px;
}
.column {
  width: 100%;
  max-width: var(--max-column-width);
  display: inline-block;
  vertical-align: top;
}
.text_table {
  width: 100%;
  max-width: var(--max-column-width);
}
table.text_table td {
  width: 100%;
  max-width: var(--max-column-width);
}
.star {
  height: var(--star-size);
}
.empty-star {
  background-color: black;
  width: var(--star-empty-width);
}
.filled-star {
  background-color: #6699cc;
  width: var(--star-filled-width);
}
.image-star {
  width: var(--star-size);
}
.hidden {
  display: none
}
